import LoginStyles from '../styles/login.css'; // Reuse login styles
import HomeStyles from '../styles/home.css';

const HomePage = () => {
  return (
    <div className={`${LoginStyles.authContainer} ${HomeStyles.homeContainer}`}>
      
      {/* Header konsisten dengan login */}
      <Header showBack={false} title="Selamat Datang" />
      
      {/* Konten utama */}
      <div className={LoginStyles.formContainer}>
        
        {/* Section pilihan area tubuh */}
        <div className={HomeStyles.section}>
          <h2 className={LoginStyles.title}>Pilih Area Tubuh</h2>
          <div className={HomeStyles.grid}>
            {['Betis', 'Paha', 'Punggung'].map((part) => (
              <div 
                key={part}
                className={`${LoginStyles.inputGroup} ${HomeStyles.card}`}
              >
                <span>ðŸ¦µ</span>
                <p>{part}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Section pilihan teknik */}
        <div className={HomeStyles.section}>
          <h2 className={LoginStyles.title}>Level Teknik</h2>
          <div className={HomeStyles.chipContainer}>
            {['Pemula', 'Menengah', 'Lanjutan'].map((level) => (
              <div 
                key={level}
                className={`${LoginStyles.button} ${HomeStyles.chip}`}
              >
                {level}
              </div>
            ))}
          </div>
        </div>

        {/* CTA Button dengan style tombol login */}
        <button 
          className={`${LoginStyles.button} ${HomeStyles.ctaButton}`}
          onClick={handleStart}
        >
          Mulai Belajar
        </button>
      </div>

      {/* Footer sama dengan login page */}
      <Footer />
    </div>
  );
};
